import React from "react";
import Cookies from "universal-cookie";

export default function Home() {
  const cookies = new Cookies();
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Forside</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body">
            <a onClick={showDetails.bind(this)} data-device-id="1">
              Forside
            </a>
          </div>
        </div>
      </div>
    </div>
  );

  function showDetails(e) {
    cookies.set("cerrentDeviceID", e.currentTarget.dataset.deviceid, {
      path: "/"
    });
    window.location.href = "/details";
  }
}
